import React from 'react';

import CountryNavigation from './CountryNavigation';

export default function Country({ country }) {
	return (
		<>
			<CountryNavigation />
			<section className="bg-slate-600">
				<div className="bg-red-200"></div>
				<div className="bg-green-200"></div>
			</section>
		</>
	);
}
